import React from 'react'
import Header from '../components/Layout/Header'
import EventCard from '../components/Route/Event/EventCard'

const EventsPage = () => {
  return (
    <div>
        <Header activeHandling={4} />
        <EventCard active={true} />
    </div>
  )
}

export default EventsPage
